<p>I created this example schema.</p>

<pre><code>var mongoose = require('mongoose');
var Schema = mongoose.Schema;
var version = require('mongoose-version');

var PageSchema = new Schema({
    title : { type : String, required : true},
    tags : [String],
});

PageSchema.plugin(version, { collection: 'Page__versions' });

const PageModel = mongoose.model('PageModel', PageSchema)
</code></pre>

<p>So all versions are stored in collection <code>Page__versions</code>, but how can I query this collection, because I don't have a model for that collection.</p>

