How can I verify admin in frontend from backend? (Node.js, Angular, Mongodb)<p>In the user model, I have a property called <code>isAdmin</code> which default value is <code>false</code>. In MongoDB, I manually created an admin account who has property <code>isAdmin</code> set to <code>true</code>. When I log in as an admin, the program verifies it and terminal shows "admin". But how move this <code>true</code> value to frontend to check if it's admin? What can I write then in frontend?</p>

<pre><code>    isAdmin: {
        type: Boolean,
        default: false
    },
</code></pre>

<pre><code>router.post('/login', (req, res) =&gt; { 
  let userData = req.body;

  User.findOne({ email: userData.email }, (error, user) =&gt; {
    if (error) {
      console.log(error);
    } else {
      if (!user) {
        res.status(401).send('Invalid email');
      } else
        if (user.password !== userData.password) {
          res.status(401).send('Invalid password')
        } else {
          if (user.isAdmin) { // admin &lt;--------------------
            console.log('admin');          
          }
          let payload = { subject: user._id };
          let token = jwt.sign(payload, 'secretKey');
          res.status(200).send({ token });
        }
    }

  })
})
</code></pre>

